import React from 'react';
import { Row, Col, Button } from 'react-bootstrap';

const Home = () => {

    const OnClick = async () => {
          window.location.hash = "#/list";
      };

return (
    <React.Fragment>
        <Row>
          <Col>
            Bienvenue
          </Col>
        </Row>
        <Button type="link" OnClick={OnClick}>
          Focus+
        </Button>
    </React.Fragment>
    );
};

export default Home;
